import React, { useState, createContext, useContext } from 'react';
import { PipelineToolbar } from './toolbar';
import { PipelineUI } from './ui';
import { SubmitButton } from './submit';
import { Switch, FormControlLabel, CssBaseline, createTheme, ThemeProvider } from '@mui/material';

// Create a Theme Context
const ThemeContext = createContext();

// Function to generate random node data
const generateRandomNodes = (numNodes) => {
  let nodes = [];
  for (let i = 1; i <= numNodes; i++) {
    nodes.push({
      id: i.toString(),
      type: i === 1 ? 'input' : i === numNodes ? 'output' : 'default',
      data: { label: `Node ${i}` },
      position: {
        x: Math.floor(Math.random() * 800),
        y: Math.floor(Math.random() * 600)
      },
      style: {
        border: '1px solid black',
        padding: '10px',
        borderRadius: '5px',
        backgroundColor: `hsl(${Math.floor(Math.random() * 360)}, 70%, 80%)`
      }
    });
  }
  return nodes;
};

// Function to generate random edge data
const generateRandomEdges = (nodes) => {
  let edges = [];
  for (let i = 0; i < nodes.length - 1; i++) {
    edges.push({
      id: `e${i}-${i + 1}`,
      source: nodes[i].id,
      target: nodes[i + 1].id,
      animated: Math.random() > 0.3,
      label: `Edge ${i}-${i + 1}`,
      style: {
        stroke: `hsl(${Math.floor(Math.random() * 360)}, 70%, 50%)`
      }
    });
  }
  for (let i = 0; i < nodes.length - 2; i++) {
    if (Math.random() > 0.7) {
      edges.push({
        id: `e${i}-${i + 2}`,
        source: nodes[i].id,
        target: nodes[i + 2].id,
        animated: Math.random() > 0.5,
        label: `Cross-link ${i}-${i + 2}`,
        style: {
          stroke: `hsl(${Math.floor(Math.random() * 360)}, 70%, 50%)`
        }
      });
    }
  }
  return edges;
};

// ThemeContextProvider to manage the dark/light mode
const ThemeContextProvider = ({ children }) => {
  const [darkMode, setDarkMode] = useState(false);

  const theme = createTheme({
    palette: {
      mode: darkMode ? 'dark' : 'light',
    },
  });

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
  };

  return (
    <ThemeContext.Provider value={{ darkMode, toggleDarkMode }}>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        {children}
      </ThemeProvider>
    </ThemeContext.Provider>
  );
};

// Main App Component
function App() {
  const [nodes, setNodes] = useState(generateRandomNodes(4));
  const [edges, setEdges] = useState(generateRandomEdges(nodes));

  const handleGenerateData = () => {
    const newNodes = generateRandomNodes(6);
    const newEdges = generateRandomEdges(newNodes);
    setNodes(newNodes);
    setEdges(newEdges);
  };

  return (
    <ThemeContextProvider>
      <div style={{ padding: '19px', position: 'relative' }}>
        <PipelineToolbar />
        <PipelineUIWrapper />
        <SubmitButton nodes={nodes} edges={edges} onGenerateData={handleGenerateData} />
        <DarkModeToggle />
      </div>
    </ThemeContextProvider>
  );
}

// Component to handle the Pipeline UI
const PipelineUIWrapper = () => {
  const { darkMode } = useContext(ThemeContext);
  return <PipelineUI darkMode={darkMode} />;
};

// Component for the Dark Mode Toggle Switch
const DarkModeToggle = () => {
  const { darkMode, toggleDarkMode } = useContext(ThemeContext);
  return (
    <div style={{ position: 'absolute', top: 20, right: 20 }}>
      <FormControlLabel
        control={<Switch checked={darkMode} onChange={toggleDarkMode} />}
        label={darkMode ? 'Dark Mode' : 'Light Mode'}
      />
    </div>
  );
};

export default App;
